def kill_all_child_processes():
    """Đóng tất cả các tiến trình con"""
    for process in active_processes.copy():
        try:
            # Nếu là QProcess
            if isinstance(process, QProcess):
                process.kill()
                process.waitForFinished(1000)  # Chờ 1 giây
            
            # Nếu là subprocess hoặc psutil Process
            elif hasattr(process, 'terminate'):
                process.terminate()
                
            # Loại bỏ khỏi danh sách
            if process in active_processes:
                active_processes.remove(process)
        except Exception as e:
            print(f"Lỗi khi đóng tiến trình: {e}")

def find_process_using_port(port):
    """Tìm và trả về PID của tiến trình đang sử dụng cổng"""
    for conn in psutil.net_connections():
        if conn.laddr.port == port:
            try:
                process = psutil.Process(conn.pid)
                return process
            except psutil.NoSuchProcess:
                return None
    return None

def kill_process_on_port(port):
    """Giết tiến trình đang sử dụng cổng"""
    try:
        for conn in psutil.net_connections():
            if conn.laddr.port == port:
                try:
                    process = psutil.Process(conn.pid)
                    process.terminate()
                    process.wait(timeout=5)
                    return True
                except (psutil.NoSuchProcess, psutil.AccessDenied, psutil.TimeoutExpired):
                    pass
    except Exception as e:
        print(f"Lỗi khi tìm và đóng tiến trình: {e}")
    return False

class FRPCThread(QThread):
    connection_success = pyqtSignal(str)
    connection_error = pyqtSignal(str)
    log_output = pyqtSignal(str)

    def __init__(self, config_path):
        super().__init__()
        self.config_path = config_path
        self.process = None
        self.web_port = None

    def run(self):
        try:
            # Kiểm tra và giải phóng cổng web server
            self.web_port = self.extract_web_port()
            if self.web_port:
                kill_process_on_port(int(self.web_port))

            # Sử dụng QProcess để có thể đọc output một cách đáng tin cậy hơn
            self.process = QProcess()
            active_processes.append(self.process)
            
            self.process.readyReadStandardOutput.connect(self.handle_stdout)
            self.process.readyReadStandardError.connect(self.handle_stderr)
            
            # Thử chạy frpc với đầy đủ đường dẫn
            frpc_path = self.find_frpc_executable()
            if not frpc_path:
                self.connection_error.emit("Không tìm thấy frpc.exe")
                return

            # Chạy process
            self.process.start(frpc_path, ["-c", self.config_path])
            
            # Đợi một khoảng thời gian ngắn để frpc khởi động
            QThread.msleep(2000)  # Đợi 2 giây
            
            # Thử lấy địa chỉ public từ API
            self.fetch_public_address()

        except Exception as e:
            self.connection_error.emit(f"Lỗi khởi chạy: {str(e)}")
        
    def fetch_public_address(self):
        """Lấy địa chỉ public từ API web quản trị"""
        try:
            # Đọc thông tin web server từ config
            config = toml.load(self.config_path)
            web_config = config.get('webServer', {})
            
            web_addr = web_config.get('addr', '127.0.0.1')
            web_port = web_config.get('port', 7400)
            web_user = web_config.get('user', 'admin')
            web_password = web_config.get('password', 'admin')

            # Gọi API status
            url = f"http://{web_addr}:{web_port}/api/status"
            
            try:
                response = requests.get(url, 
                                       auth=(web_user, web_password), 
                                       timeout=5)
            except requests.exceptions.RequestException as req_err:
                self.log_output.emit(f"Lỗi kết nối: {req_err}")
                self.connection_error.emit(f"Lỗi kết nối: {req_err}")
                return

            if response.status_code == 200:
                try:
                    status_data = response.json()
                    
                    # Lấy remote_addr từ proxy đầu tiên bất kể giao thức
                    for protocol in status_data.values():
                        if isinstance(protocol, list) and len(protocol) > 0:
                            first_proxy = protocol[0]
                            if 'remote_addr' in first_proxy:
                                public_addr = first_proxy['remote_addr']
                                self.connection_success.emit(public_addr)
                                return

                    self.connection_error.emit("Không tìm thấy địa chỉ public")
                
                except ValueError as json_err:
                    self.log_output.emit(f"Lỗi JSON: {json_err}")
                    self.connection_error.emit(f"Lỗi phân tích JSON: {json_err}")
            
            else:
                self.connection_error.emit(f"Lỗi API: {response.status_code}")

        except Exception as e:
            self.log_output.emit(f"Lỗi không xác định: {e}")
            self.connection_error.emit(f"Lỗi lấy địa chỉ public: {e}")

    def find_frpc_executable(self):
        # Danh sách các vị trí có thể của frpc.exe
        possible_locations = [
            "frpc.exe",  # Trong thư mục hiện tại
            os.path.join(os.getcwd(), "frpc.exe"),
            r"C:\Program Files\frp\frpc.exe",
            r"C:\frp\frpc.exe"
        ]

        for location in possible_locations:
            if os.path.exists(location):
                return location
        
        return None

    def handle_stdout(self):
        process = self.sender()
        output = bytes(process.readAllStandardOutput()).decode()
        self.log_output.emit(output)

        # Tìm địa chỉ public từ log
        match = re.search(r'remote\s*(\d+\.\d+\.\d+\.\d+:\d+)', output)
        if match:
            public_addr = match.group(1)
            self.connection_success.emit(public_addr)

    def handle_stderr(self):
        process = self.sender()
        error = bytes(process.readAllStandardError()).decode()
        self.log_output.emit(f"Error: {error}")
        self.connection_error.emit(error)

    def extract_web_port(self):
        """Trích xuất port web server từ file config"""
        try:
            config = toml.load(self.config_path)
            return config.get('webServer', {}).get('port')
        except:
            return None

class SingleInstanceManager:
    def __init__(self):
        self.server = None
        self.socket = QLocalSocket()
        self.app_id = "FRPConnector_SingleInstance"
        
    def try_connect(self):
        """Thử kết nối đến instance đang chạy"""
        self.socket.connectToServer(self.app_id)
        if self.socket.waitForConnected(500):
            # Gửi signal để hiển thị cửa sổ của instance đang chạy
            self.socket.write(b"show")
            self.socket.flush()
            return True
        return False
        
    def listen(self):
        """Lắng nghe kết nối từ các instance khác"""
        self.server = QLocalServer()
        # Đảm bảo không có server cũ nào đang chạy
        self.server.removeServer(self.app_id)
        # Lắng nghe kết nối mới
        self.server.listen(self.app_id)
        return self.server

class FRPConfigApp(QMainWindow):
    def __init__(self):
        super().__init__()
        
        # Thêm server để lắng nghe các instance khác
        self.server = None
        
        # Khởi tạo biến theme - mặc định là dark
        self.is_dark_mode = True
        
        # Tạo icon từ bytes nhúng sẵn
        self.app_icon = None
        try:
            # Tạo temporary file để lưu icon
            icon_data = QByteArray(EMBEDDED_ICON)
            buffer = QBuffer(icon_data)
            buffer.open(QBuffer.OpenModeFlag.ReadOnly)
            self.app_icon = QIcon()
            self.app_icon.addPixmap(QPixmap.fromImage(QImage.fromData(icon_data)))
            self.setWindowIcon(self.app_icon)
        except Exception as e:
            print(f"Lỗi khởi tạo icon: {e}")
        
        # Khởi tạo system tray
        self.tray = QSystemTrayIcon(self)
        if self.app_icon:
            self.tray.setIcon(self.app_icon)
        self.setup_system_tray()
        
        # Khởi tạo UI
        self.initUI()
        self.load_existing_config()
        self.installEventFilter(self)

    def setup_system_tray(self):
        """Thiết lập system tray icon và menu"""
        # Tạo menu cho system tray
        self.tray_menu = QMenu()
        
        # Thêm action Show Window
        show_action = QAction("Show Window", self)
        show_action.triggered.connect(self.show_window)
        self.tray_menu.addAction(show_action)
        
        # Thêm action Quit
        quit_action = QAction("Quit", self)
        quit_action.triggered.connect(self.quit_application)
        self.tray_menu.addAction(quit_action)
        
        # Gán menu cho system tray
        self.tray.setContextMenu(self.tray_menu)
        
        # Xử lý khi click vào icon
        self.tray.activated.connect(self.tray_icon_activated)
        
        # Hiển thị system tray icon
        self.tray.show()

    def show_window(self):
        """Hiển thị cửa sổ chính"""
        self.show()
        self.activateWindow()

    def quit_application(self):
        """Thoát hoàn toàn khỏi ứng dụng"""
        # Dừng tất cả tiến trình
        kill_all_child_processes()
        # Ẩn system tray trước khi thoát
        if self.tray:
            self.tray.hide()
        # Thoát ứng dụng
        QApplication.quit()

    def tray_icon_activated(self, reason):
        """Xử lý khi click vào icon trong system tray"""
        if reason == QSystemTrayIcon.ActivationReason.Trigger:
            self.show_window()

    def closeEvent(self, event):
        """Xử lý khi đóng cửa sổ"""
        if self.tray and self.tray.isVisible():
            # Ẩn cửa sổ thay vì đóng
            self.hide()
            # Hiển thị thông báo trong system tray
            self.tray.showMessage(
                "FRP Connector",
                "Application was minimized to tray",
                QSystemTrayIcon.MessageIcon.Information,
                2000
            )
            event.ignore()
        else:
            # Nếu không có system tray thì thoát bình thường
            kill_all_child_processes()
            event.accept()

    def eventFilter(self, obj, event):
        """Bắt sự kiện đóng ứng dụng"""
        if obj is self and event.type() == event.Type.Close:
            # Không cần kill process ở đây nữa vì đã xử lý trong closeEvent
            pass
        return super().eventFilter(obj, event)

    def load_existing_config(self):
        if os.path.exists("frpc.toml"):
            try:
                config = toml.load("frpc.toml")
                
                # Load toàn bộ các trường từ config
                self.server_ip.setText(config.get('serverAddr', '').strip('"'))
                self.server_port.setText(str(config.get('serverPort', '')))
                
                # Load thông tin web server
                web_config = config.get('webServer', {})
                self.web_addr_entry.setText(web_config.get('addr', '').strip('"'))
                self.web_port_entry.setText(str(web_config.get('port', '')))
                self.web_user_entry.setText(web_config.get('user', '').strip('"'))
                self.web_password_entry.setText(web_config.get('password', '').strip('"'))
                
                # Load thông tin proxy
                proxies = config.get('proxies', [{}])[0]
                self.local_ip.setText(proxies.get('localIP', '').strip('"'))
                self.local_port.setText(str(proxies.get('localPort', '')))
                self.remote_port.setText(str(proxies.get('remotePort', '')))
                self.protocol.setCurrentText(proxies.get('type', 'tcp'))
                
            except Exception as e:
                print(f"Lỗi đọc config: {e}")

    def generate_config(self):
        # Tạo config y hệt như file gốc
        return f"""serverAddr = "{self.server_ip.text()}"
serverPort = {self.server_port.text()}
webServer.addr = "{self.web_addr_entry.text()}"
webServer.port = {self.web_port_entry.text()}
webServer.user = "{self.web_user_entry.text()}"
webServer.password = "{self.web_password_entry.text()}"
[[proxies]]
name = "rdp"
type = "{self.protocol.currentText()}"
localIP = "{self.local_ip.text()}"
localPort = {self.local_port.text()}
remotePort = {self.remote_port.text()}"""

