        window_size = self.frameGeometry()
        
        # Tính toán vị trí X để cửa sổ nằm giữa theo chiều ngang
        center_x = screen.center().x()
        new_x = center_x - (window_size.width() // 2)
        
        # Tính toán vị trí Y để cửa sổ cách lề trên 5%
        new_y = int(screen.height() * 0.05)
        
        # Di chuyển cửa sổ đến vị trí mới
        self.move(new_x, new_y)

